import React from "react";
const img="img/afsar.jpg"
const Resume =()=>{
    return (
        <>
                <h1>Resume</h1>
                <img src={img} alt="Afsar image" style={{height:"600px", borderRadius:"20px"}}></img>
                <h1>Personal Details</h1>
                <ul style={{display:"flex",flexDirection:"column"}}>
                    <li >Name : <span style={{fontWeight:"800", color:"red"}}>Md Afsar</span></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
                
        </>
    )
}
export default Resume;
